import React from "react";
import Header from "./Header";
import {  useNavigate } from 'react-router-dom';
import { useState,useEffect } from "react";
import axios from "axios";

function Caretakers(){
    const Navigate=useNavigate();
    const[patientlist, setPatientlist]=useState(null)
    useEffect(()=>{
        const function1 = async() => {
            const response=await axios.get("/en/getpatients")
            setPatientlist(response.data);
        }
        function1();
    },[])
    const handleUpload=()=>{
        Navigate('/Upload');
    }
    return(
        <div className="Caretakeer">
            <Header/>
            <div className="firstccaretaker">
            <div className="caretakerheader"> 
                <div className="careheading"><h2>Patients List</h2></div>
                <div className="careUpload" onClick={handleUpload}><h3>Add Patient</h3> </div>
            </div>
            <div>

            </div>
            <table>
                <thead>
                <tr>
                  <th>Patient Id</th>
                  <th>Name</th>
                  <th>Age</th>
                  <th>Gender</th>
                  <th>Phone Number</th>
                </tr>
                </thead>
                <tbody></tbody>
                <tr>
                  <td>12345</td>
                  <td>Suresh</td>
                  <td>45y</td>
                  <td>Male</td>
                  <td>9856324567</td>
                </tr>
                
            </table>


            </div>

        </div>
    );
}
export default Caretakers;
